import React, { useState } from 'react';
import axios from 'axios';

const BicycleRegistration = () => {
  const [shortDescription, setShortDescription] = useState('');
  const [longDescription, setLongDescription] = useState('');
  const [status, setStatus] = useState('Available');
  const [type, setType] = useState('');

  const handleRegister = () => {
    axios.post('http://localhost:8081/bicycles', { shortDescription, longDescription, status, type })
      .then(() => alert('Bicycle registered successfully!'))
      .catch((error) => console.error('Error registering bicycle:', error));
  };

  return (
    <div className="card">
      <h2>Bicycle Registration</h2>
      <input type="text" placeholder="Short Description" value={shortDescription} onChange={(e) => setShortDescription(e.target.value)} />
      <input type="text" placeholder="Long Description" value={longDescription} onChange={(e) => setLongDescription(e.target.value)} />
      <input type="text" placeholder="Type" value={type} onChange={(e) => setType(e.target.value)} />
      <select value={status} onChange={(e) => setStatus(e.target.value)}>
        <option value="Available">Available</option>
        <option value="Unavailable">Unavailable</option>
      </select>
      <button onClick={handleRegister}>Register Bicycle</button>
    </div>
  );
};

export default BicycleRegistration;
